ms for Boulder\" src=\"ref://bb636dfaa8\" caption=\"results including Innsbruck 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Cup wins and podiums for Lead\" src=\"ref://7ba44768ef\" caption=\"results including Briancon 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Cup wins and podiums for Speed\" src=\"ref://34c37ee6f9\" caption=\"results including Chamonix 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Cup wins and podiums all disciplines\" src=\"ref://6c51ac8233\" caption=\"results including Briancon 2023 event\"/\u003e\u003cGroup label=\"Country lock-out of the podium in World Cup and World Champs\u0027\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://c2669d23f9\" caption=\"results including Briancon 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fc7b00b9ea\" caption=\"results including Briancon 2023 event\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Cup Series, best ever performance by gender and discipline\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[- Use the filters to select the **Country** , **Discipline** and **Gender**, you should always select a country  \n- On the filters pick the option **Begins With**, the text does not need any quotes\n- Then sort on the **FinPosn**, by clicking on the cell header  \nNow you have the best 10 results ever for that country, for the filters you picked, as long as they have had a finish in the top 50]]\u003e\u003c/Text\u003e\u003cDataTable type=\"application/vnd.apache.arrow+binary\" rows=\"1583\" columns=\"6\" schema=\"[]\" src=\"ref://611a5e55fc\" caption=\"results including Briancon 2023 event\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Country with Most people in a final  \nMale Lead \t\t- Japan - WC Briancon 2023 - 7 Men  \n                - Japan - WC Jakarta 2022 - 4 Men  \n                - Japan - WC Villars 2022 - 4 Men  \n\t\t\t\t- Japan - WC Xiamen 2019 - 4 Men  \n\nFemale Lead \t- Austria - WChamp 2011 - 5 Women  \n\t\t\t\t- Slovenia - WC Villars 2021 - 4 Women  \n\t\t\t\t- Japan - WC Inzai 2019 - 4 Women  \n\t\t\t\t- Slovenia - WC Xiamen 2018 - 4 Women  \n\t\t\t\t- Slovenia - WC Briancon 2018 - 4 Women   \n\t\t\t\t- Austria - WC Barcelona 2011 - 4 Women  \n\t\t\t\t- Austria - WC Valence 2011 4 Women  \n\t\t\t\t- Austria - WC Puurs 2011 - 4 Women  \n\nMens Boulder \t- Japan - WC Seoul 2022 - 5 Men  \n\t\t\t\t- Japan - WC Meiringen 2021 - 4 Men  \n\t\t\t\t- Japan - WC Meiringen 2019 - 4 Men  \n\t\t\t\t- Japan - WC Wuijang 2019 - 4 Men  \n\t\t\t\t- Japan - WC Vail 2018 - 4 Men  \n\t\t\t\t- Japan - WC Munich 2017 - 4 Men  \n\t\t\t\t- France - WC Laval 2014 - 4 Men  \n\t\t\t\t- Japan - WC Vail 2017 - 4 Men  \n\nFemale Boulder \t- France - WC La Reunion 2007 - 4 Women  \n\t\t\t\t- USA - WC Vail 2008 - 3 Women  \n\t\t\t\t- Slovenia - WC Munich 2019 - 3 Women  \n\t\t\t\t- Japan - WC Vail 2019 - 3 Women]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Special Analysis World Cups\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Male Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://c0a26a7080\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Female Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://034ed67f37\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://ddcdc1712e\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://3b06855704\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals \u0026amp; Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://163e09b954\"/\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### This explains the Speed box plots  \nThe horizontal lines bottom and top are the min and max values  \nThe line across the waist of the box is the median value  \nThe bottom and top of the box are the 1st and 3rd quartile values  \nThe dots at the top are statistical outliers  \n\n  Hover on a box and it will show all the values  \n\n### Speed Analysis  \nparticuluarly in the Mens results you can see the height of the box has shrunk meaning the times of the majority and getting closer  \n2021 only had 2 events so doesn\u0027t have as much variation as normal years with more events.  \nThe times before 2012 were so slow you couldn\u0027t see the detail in the later years  \nThis is qualifying times only, the finals times are harder to collate as the format on the IFSC website has changed over the years  \n\n### Lead Analysis  \nThis show that generally there are more tops in female lead comps than there are in mens, this indicates the women are not being challenged as much as the men.  \nIn Finals in 12 of the last 16 years there have been more female tops, only 2 years where there were more tops, and 2 years where they were the same.]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"79226e8582": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfMGM0ZmNfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KI1RfMGM0ZmNfcm93MF9jb2wxIHsKICB3aWR0aDogMTBlbTsKICBoZWlnaHQ6IDgwJTsKICBiYWNrZ3JvdW5kOiBsaW5lYXItZ3JhZGllbnQoOTBkZWcsbGlnaHRibHVlIDEwMC4wJSwgdHJhbnNwYXJlbnQgMTAwLjAlKTsKfQojVF8wYzRmY19yb3cxX2NvbDEgewogIHdpZHRoOiAxMGVtOwogIGhlaWdodDogODAlOwogIGJhY2tncm91bmQ6IGxpbmVhci1ncmFkaWVudCg5MGRlZyxsaWdodGJsdWUgNzguOSUsIHRyYW5zcGFyZW50IDc4LjklKTsKfQojVF8wYzR
